import { useEffect, useState } from "react";
import axios from "axios";
import Coin from "./component/Coin";
import Nav from "./component/Nav";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import CoinDetails from "./component/CoinDetails";

function App() {
  const url =
    "https://api.coingecko.com/api/v3/coins/markets?vs_currency=usd&order=market_cap_desc&per_page=30&page=1&sparkline=false&locale=en";
  const [coins, setCoins] = useState([]);

  console.log(coins[0]);

  useEffect(() => {
    axios
      .get(url)
      .then((response) => setCoins(response.data))
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div className="App">
      <Nav />
      <Router>
        <Routes>
          <Route path="/" element={<Coin coins={coins} />} />
          <Route path="/coin/:id" element={<CoinDetails coins={coins[2]} />} />
          <Route path="*" element={<h1>hello there</h1>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
